      SELECT ALL * FROM tab0 (FORMAT parquet) WHERE NOT - col2 IN ( + 33 * + col2 * - + col2, + col2 * + ( col1 ) + - 41 - - col2 / - 92 * + col1, - - col0 );
  - name: tab0

outputs:
  - name: q4534.out
    data: |
      15	81	47
      87	21	10
      97	1	99
